import React from 'react';
import SearchBox from './SearchBox';
import Cities from './Cities';
import AllWeatherInfo from './AlllWeatherInfo';

const HomeLeft = () => {

    // console.log(document.querySelector("#leftContainer").style.outline);
    document.querySelector("#leftContainer").style.outline = "1px solid white";

    return (
        <div className="col" id="leftContainer">
            <SearchBox />

            <div className="weatherTitle">
                <h1>Weather <strong>Forecast</strong></h1>
            </div>

            <Cities />

            <AllWeatherInfo />
            
        </div>
    );
};

export default HomeLeft;
